import React from 'react';
import Navigation from "./components/Navigation";

function App() {

  const navLink1= {title:'AboutTyler', link: 'about.html'};
  const navLink2 = {title:'Explore History Dynamic', link: 'resources.html'};

  const navLinks=[{title:'AboutTyler', link: 'about.html'},{title:'Explore History Dynamic', link: 'resources.html'}];

  return (
    <Navigation name="Awhshvini" link1={navLink1} link2={navLink2} links={navLinks}></Navigation>
  );
}

export default App;
